import multiprocessing
import random
def solution(n, works):
    
    works.sort(reverse = True)
    sum_val = sum(works)
    min_value = (sum_val - n) / len(works)
    if min_value <= 0:
        return 0
    min_value = int(min_value)
    answer = 0
    num = sum_val - n
    while works:
        tmp = works.pop()
        if tmp <= min_value:
            answer += tmp ** 2
            num -= tmp
        else:
            works.append(tmp)
            break
    ori_works = [x for x in works]
    works = [min_value] * len(works)
    num = num - sum(works)
    while works:
        works = [x + num // len(works) for x in works]
        for i in range(num % len(works)):
            works[i] += 1
        if works[-1] >= ori_works[-1]:
            num = num - len(works) * (ori_works[-1] - min_value)
            min_value = ori_works[-1]
            answer += ori_works[-1] ** 2
            works.pop()
            ori_works.pop()
            works = [min_value] * len(works)
        else:
            break
    answer += sum([x ** 2 for x in works])
    return answer


import heapq

def solution2(n, works):
    if n >= sum(works):
        return 0
    
    works = [-w for w in works]
    heapq.heapify(works)
    for _ in range(n):
        i = heapq.heappop(works)
        i += 1
        heapq.heappush(works, i)
    return sum([w ** 2 for w in works])

